"     Reproduced from: Sieff, CA, Zon, LI. Anatomy and Physiology of Hematopoiesis. In: Nathan and Oski's Hematology of Infancy and Childhood, 7th ed, Orkin, S, Fisher, D, Look, AT, et al. (Eds) Elsevier, Philadelphia 2009. Illustration used with the permission of Elsevier Inc. All rights reserved.",
