"   <div class=\"block pha drugH1Div\" id=\"F153594\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Mechanism of Action",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Clopidogrel requires",
"     <i>",
"      in vivo",
"     </i>",
"     biotransformation to an active thiol metabolite. The active metabolite irreversibly blocks the P2Y",
"     <sub>",
"      12",
"     </sub>",
"     component of ADP receptors on the platelet surface, which prevents activation of the GPIIb/IIIa receptor complex, thereby reducing platelet aggregation. Platelets blocked by clopidogrel are affected for the remainder of their lifespan (~7-10 days).",
"    </p>",
"   </div>",
"   <div class=\"block phk drugH1Div\" id=\"F153610\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Pharmacodynamics/Kinetics",
"    </span>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Onset of action: Inhibition of platelet aggregation (IPA): Dose-dependent:",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     300-600 mg loading dose: Detected within 2 hours",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     50-100 mg/day: Detected by the second day of treatment",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Peak effect: Time to maximal IPA: Dose-dependent:",
"     <b>",
"      Note:",
"     </b>",
"     Degree of IPA based on adenosine diphosphate (ADP) concentration used during light aggregometry:",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     300-600 mg loading dose:",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:6em;text-align:justify;\">",
"     ADP 5 micromole/L: 20% to 30% IPA at 6 hours post administration (Montelescot, 2006)",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:6em;text-align:justify;\">",
"     ADP 20 micromole/L: 30% to 37% IPA at 6 hours post administration (Montelescot, 2006)",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     50-100 mg/day: ADP 5 micromole/L: 50% to 60% IPA at 5-7 days (Herbert, 1993)",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Absorption: Well absorbed",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Protein binding: Parent drug: 98%; Inactive metabolite: 94%",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Metabolism: Extensively hepatic via esterase-mediated hydrolysis to a carboxylic acid derivative (inactive) and via CYP450-mediated (CYP2C19 primarily) oxidation to a thiol metabolite (active)",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Half-life elimination: Parent drug: ~6 hours; Active metabolite: ~30 minutes",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Time to peak, serum: ~0.75 hours",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Excretion: Urine (50%); feces (46%)",
"    </p>",
"   </div>",
